o de téléphone","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_REFUSAL_PAGE_174","ordinal":174,"pageType":"REFUSAL_PAGE","locale":"fr","value":"Fermer le message","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_REFUSAL_PAGE_175","ordinal":175,"pageType":"REFUSAL_PAGE","locale":"fr","value":"Retour vers la boutique en ligne","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_HELP_PAGE_1","ordinal":1,"pageType":"HELP_PAGE","locale":"fr","value":"<b>Aide</b>","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_HELP_PAGE_2","ordinal":2,"pageType":"HELP_PAGE","locale":"fr","value":"Afin d\'augmenter votre sécurité lors des paiements en ligne, votre banque a mis en place une authentification en deux étapes. Afin de pouvoir effectuer un paiement, vous devez le confirmer soit au moyen d\'un code d\'activation par SMS, soit par la vérification de votre personne sur une App d\'authentification mobile. Pour ce service, vous devez vous enregistrer une fois. Pour la procédure d\'enregistrement correspondante, ou pour les modifications de votre méthode d\'authentification, veuillez vous adresser à votre banque.","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_HELP_PAGE_174","ordinal":174,"pageType":"HELP_PAGE","locale":"fr","value":"Fermer le texte d\'aide","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_FAILURE_PAGE_11","ordinal":11,"pageType":"FAILURE_PAGE","locale":"fr","value":"<b>Informations concernant le paiement.</b>","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_FAILURE_PAGE_16","ordinal":16,"pageType":"FAILURE_PAGE","locale":"fr","value":"Le paiement n\'a pas été effectué - La carte n\'est pas enregistrée pour 3D Secure","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_FAILURE_PAGE_17","ordinal":17,"pageType":"FAILURE_PAGE","locale":"fr","value":"Le paiement n\'as pas pu être effectué car votre carte n\'est pas enregistrée pour les paiements 3D Secure. Si vous souhaitez poursuivre l\'achat, nous vous prions d\'enregistrer votre carte conformément aux instructions de votre banque.","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_FAILURE_PAGE_32","ordinal":32,"pageType":"FAILURE_PAGE","locale":"fr","value":"Paiement non effectué - Problème technique","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_FAILURE_PAGE_33","ordinal":33,"pageType":"FAILURE_PAGE","locale":"fr","value":"En raison d\'une erreur technique, le paiement n\'a pas pu être effectué. Si vous souhaitez poursuivre l\'achat, nous vous prions de bien vouloir essayer à nouveau.","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_FAILURE_PAGE_41","ordinal":41,"pageType":"FAILURE_PAGE","locale":"fr","value":"Aide","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_FAILURE_PAGE_174","ordinal":174,"pageType":"FAILURE_PAGE","locale":"fr","value":"Fermer le message","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_FAILURE_PAGE_175","ordinal":175,"pageType":"FAILURE_PAGE","locale":"fr","value":"Retour vers la boutique en ligne","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_REFUSAL_PAGE_1","ordinal":1,"pageType":"REFUSAL_PAGE","locale":"it","value":"<b>Autorizzazione di pagamento non possibile</b>","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_REFUSAL_PAGE_2","ordinal":2,"pageType":"REFUSAL_PAGE","locale":"it","value":"Purtroppo non siamo riusciti a elaborare la sua richiesta perché non abbiamo trovato un metodo di autenticazione (SMS o app) per la sua carta. Stabilisca un metodo di autenticazione corrispondente per la sua carta nel portale di registrazione secondo le istruzioni della sua banca.","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_REFUSAL_PAGE_11","ordinal":11,"pageType":"REFUSAL_PAGE","locale":"it","value":"<b>Informazioni sul pagamento</b>","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_REFUSAL_PAGE_22","ordinal":22,"pageType":"REFUSAL_PAGE","locale":"it","value":"Pagamento non eseguito - La carta non è registrata per 3D Secure","network":"MASTERCARD"},{"name":"MASTERCARD_REFUSAL_REFUSAL_PAGE_23","ordinal":