"},{"name":"MASTERCARD_MOBILE_APP_POLLING_PAGE_175","ordinal":175,"pageType":"POLLING_PAGE","locale":"fr","value":"Retour vers la boutique en ligne","network":"MASTERCARD"},{"name":"MASTERCARD_MOBILE_APP_HELP_PAGE_1","ordinal":1,"pageType":"HELP_PAGE","locale":"fr","value":"<b>Aide</b>","network":"MASTERCARD"},{"name":"MASTERCARD_MOBILE_APP_HELP_PAGE_2","ordinal":2,"pageType":"HELP_PAGE","locale":"fr","value":"Afin d\'augmenter votre sécurité lors des paiements en ligne, votre banque a mis en place une authentification en deux étapes. Afin d\'activer un paiement, confirmez celui-ci avec un code d\'activation que vous avez reçu par SMS. Lors de chaque achat, un nouveau code unique vous sera envoyé par SMS au numéro de téléphone que vous avez enregistré. Pour modifier votre numéro de téléphone ou pour toute autre question concernant les achats en ligne avec votre carte, veuillez vous adresser à votre banque.","network":"MASTERCARD"},{"name":"MASTERCARD_MOBILE_APP_HELP_PAGE_174","ordinal":174,"pageType":"HELP_PAGE","locale":"fr","value":"Fermer l\'aide","network":"MASTERCARD"},{"name":"MASTERCARD_MOBILE_APP_FAILURE_PAGE_11","ordinal":11,"pageType":"FAILURE_PAGE","locale":"fr","value":"<b>Informations concernant le paiement.</b>","network":"MASTERCARD"},{"name":"MASTERCARD_MOBILE_APP_FAILURE_PAGE_16","ordinal":16,"pageType":"FAILURE_PAGE","locale":"fr","value":"L\'activation a échoué","network":"MASTERCARD"},{"name":"MASTERCARD_MOBILE_APP_FAILURE_PAGE_17","ordinal":17,"pageType":"FAILURE_PAGE","locale":"fr","value":"L\'authentification sur votre téléphone portable et donc l\'activation de paiement, ont échoué. Le processus de paiement a été interrompu et votre carte n\'a pas été débitée. Si vous souhaitez continuer le processus d\'achat, veuillez recommencer la tentative de paiement.","network":"MASTERCARD"},{"name":"MASTERCARD_MOBILE_APP_FAILURE_PAGE_32","ordinal":32,"pageType":"FAILURE_PAGE","locale":"fr","value":"Paiement non effectué - Problème technique","network":